import { useParams } from 'react-router-dom';
import Footer from '../../components/footer/footer';
import Header from '../../components/header/header';
import Icons from '../../components/icons/icons';
import { Guitars } from '../../types/guitar';

type GuitarFullProps = {
    guitars: Guitars;
  };

function GuitarFull ({guitars}: GuitarFullProps): JSX.Element {
  const params = useParams();
  const guitarId = Number(params.id);

  const requiredGuitar = guitars.find((guitar) => guitarId === guitar.id );

  return (
    <div className="wrapper">
      <Icons/>
      <Header />
      <main className="page-content">
        <div className="container">
          <h1 className="page-content__title title title--bigger">{requiredGuitar.name}}</h1>
          <ul className="breadcrumbs page-content__breadcrumbs">
            <li className="breadcrumbs__item"><a className="link" href="./main.html">Главная</a>
            </li>
            <li className="breadcrumbs__item"><a className="link" href="./main.html">Каталог</a>
            </li>
            <li className="breadcrumbs__item"><a className="link">Товар</a>
            </li>
          </ul>
        </div>
      </main>

      <Footer/>
    </div>
  );
}

export default GuitarFull;
